import React from 'react';
import LogoNumeroUno from './Images/Cocktail-icon.png';

const Header = (props) => {
	return (
		<div className="header-container">
			<span>
				<img
					src={LogoNumeroUno}
					alt="LogoNumeroUno"
					height="64px"
					width="64px"
				/>
				Numero Uno
			</span>
		</div>
	);
};

export default Header;
